    [],nt"revision_timestamp": "2015-09-26T22:59:00.591973",nt"name": "2010-pacific-gas-and-electric-diablo-canyon-power-plant-dcpp-diablo-canyon-ca-central-coast",nt"isopen":
    false,nt"url": null,nt"notes": "The Diablo Canyon Power Plant (DCPP) LiDAR
    and Imagery datasets are comprised of three separate LiDAR surveys: Diablo Canyon
    (2010), Diablo Canyon (2010), and San Simeon (2013). The Diablo Canyon project study
    is located in San Luis Obispo County, California, and encompasses approximately
    10,634 acres (43.03 square kilometers). Watershed Sciences, Inc. (WSI) collected
    Light Detection and Ranging (LiDAR) data on both the inland and intertidal land
    within the Diablo Canyon study area on 28 January 2010. For optimal capture of the
    intertidal zone, WSI acquired LiDAR data of the coastline during seasonal low tides
    (between 0.0 ft and peak low of around 1.5 ft) and in conjunction with a PDOP value
    of less than 3.0. This LiDAR survey utilized a Leica ALS50 Phase II laser system.
    The sensor scan angle was +/- 13 from nadir with a pulse rate designed to yield
    an average native density of more than 8 pulses per square meter over terrestrial
    surfaces. The area of interest was surveyed with an opposing flight line side-lap
    of equal-to-or-more-than 50% (equal-to-or-more-than 100% overlap) to reduce laser
    shadowing and increase surface laser painting.",nt"license_title": null,nt"extras":
